class Solution:
    def longestIdealString(self, s: str, k: int) -> int:
        i: int = 0

        # char_val, length
        sequences: dict[int, dict[int, int]] = {}
        used_keys = set()
        max_seq: int = 0

        while i < len(s):
            next_val: int = ord(s[i])
            for key in sequences:
                addition: int = 0
                for ending in sequences[key]:
                    if abs(next_val - ending) <= k:
                        addition = max(addition, sequences[key][ending] + 1)
                        max_seq = max(max_seq, addition)

                sequences[key][next_val] = addition

            if next_val not in used_keys:
                sequences[i] = {next_val: 1}
            used_keys.add(next_val)

            i += 1

        return max_seq


def main() -> None:
    sol: Solution = Solution()
    s: str = (
        ""
    )
    k: int = 8

    res: int = sol.longestIdealString(s, k)
    print(res)


if __name__ == "__main__":
    main()
